import { Box } from "@mui/system";
import { FormLabel, TextField } from "@mui/material";
import React from "react";

function AddBook() {
  return (
    <form>
      <Box
        display="flex"
        flexDirection="column"
        maxWidth={700}
        marginTop={20}
        margin="auto"
      >
        <FormLabel>Name</FormLabel>
        <TextField fullWidth name="name" variant="outlined" />
        <FormLabel>Author</FormLabel>
        <TextField fullWidth name="author" variant="outlined" />
        <FormLabel>Description</FormLabel>
        <TextField fullWidth name="desc" variant="outlined" />
        <FormLabel>Price</FormLabel>
        <TextField fullWidth name="price" variant="outlined" />
      </Box>
    </form>
  );
}

export default AddBook;
